import sys

def display_ascii_art(text, font):
    for line in text.split('\n'):
        sys.stdout.write(line + '\n')
        sys.stdout.flush()
        for i in range(len(line)):
            char = line[i]
            if char in font:
                sys.stdout.write(char + ' ')
            else:
                sys.stdout.write('. ')
        sys.stdout.flush()

def main():
    name = input("Enter your name: ")
    fonts = ["1. Standard", "2. Stretched", "3. Wide", "4. Narrow", "5. Thin", "6. Thick"]

